import React from "react";
import ReactDOM from "react-dom";

function shoppingList (props){
    return(
        <div className="shopping-list">
            <h1>
    shopping list for {props.name}
            </h1>

            <p></p>
            
        </div>

    )

}
export default shoppingList;
